import React, { Component, Fragment } from 'react';

class Todolist extends Component {
    constructor(props) {
        super(props);
        this.state = {
            inputValue: '',
            list: []
        }
    }

    render() {
        return (
            <Fragment>
                <div>
                    todo list
                </div>
                <div>
                    <input value={this.state.inputValue}/>
                    <button>add</button>
                </div>
                <ul>
                    <li>study chinese</li>
                    <li>study english</li>
                </ul>
            </Fragment>
        );
    }
}

export default Todolist;
